import React, { Component } from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from "react-responsive-carousel";
import { Image } from "semantic-ui-react";
import BannerA from "./../img/banner01re.jpg";
import BannerB from "./../img/banner02r.jpg";
import BannerC from "./../img/banner03.jpg";
import styles from "./../styles/banner.css";

export default class DemoCarousel extends Component {
  render() {
    return (
      <Carousel autoPlay infiniteLoop className={styles.carousel}>
        <Image src={BannerA} />

        <Image src={BannerB} />

        <Image src={BannerC} />
      </Carousel>
    );
  }
}
